func main() {
	// Load configuration
	cfg := config.NewServiceConfig("payment-worldpay", 8094)

	// Worldpay credentials (use sandbox for development)
	merchantCode := config.GetEnv("WORLDPAY_MERCHANT_CODE", "sandbox_merchant")
	apiKey := config.GetEnv("WORLDPAY_API_KEY", "sandbox_api_key")
	sandbox := config.GetEnv("WORLDPAY_SANDBOX", "true") == "true"

	// Initialize logger
	logger.Init(cfg.Name, cfg.LogLevel)
	logger.Info("starting Worldpay payment service",
		zap.Int("port", cfg.Port),
		zap.String("environment", cfg.Environment),
		zap.Bool("sandbox", sandbox),
	)

	// Initialize Worldpay service
	worldpayService := service.NewWorldpayService(merchantCode, apiKey, sandbox)

	// Initialize handler
	h := handler.NewHandler(worldpayService)

	// Setup routes
	mux := http.NewServeMux()
	h.RegisterRoutes(mux)

	// Apply middleware
	var httpHandler http.Handler = mux
	httpHandler = middleware.Logging(httpHandler)
	httpHandler = middleware.Recovery(httpHandler)

	// Create server
	server := &http.Server{
		Addr:         fmt.Sprintf(":%d", cfg.Port),
		Handler:      httpHandler,
		ReadTimeout:  30 * time.Second,
		WriteTimeout: 30 * time.Second,
		IdleTimeout:  60 * time.Second,
	}

	// Start server
	go func() {
		logger.Info("Worldpay payment service listening", zap.String("addr", server.Addr))
		if err := server.ListenAndServe(); err != nil && err != http.ErrServerClosed {
			logger.Fatal("failed to start server", zap.Error(err))
		}
	}()

	// Wait for interrupt signal
	quit := make(chan os.Signal, 1)
	signal.Notify(quit, syscall.SIGINT, syscall.SIGTERM)
	<-quit

	logger.Info("shutting down server...")

	// Graceful shutdown
	ctx, cancel := context.WithTimeout(context.Background(), 30*time.Second)
	defer cancel()

	if err := server.Shutdown(ctx); err != nil {
		logger.Fatal("server forced to shutdown", zap.Error(err))
	}

	logger.Info("server exited properly")
}

func NewWorldpayService(merchantCode, apiKey string, sandbox bool) *WorldpayService {
	apiURL := "https://api.worldpay.com/v1"
	if sandbox {
		apiURL = "https://api.sandbox.worldpay.com/v1"
	}

	// Create HTTP client with reasonable timeouts
	client := &http.Client{
		Timeout: 30 * time.Second,
		Transport: &http.Transport{
			TLSClientConfig: &tls.Config{
				MinVersion: tls.VersionTLS12,
			},
		},
	}

	return &WorldpayService{
		httpClient:     client,
		apiURL:         apiURL,
		merchantCode:   merchantCode,
		apiKey:         apiKey,
		customers:      make(map[string]string),
		paymentMethods: make(map[string][]*model.PaymentMethod),
	}
}

func (h *Handler) RegisterRoutes(mux *http.ServeMux) {
	// Health check
	mux.HandleFunc("/health", h.healthCheck)

	// Payment routes
	mux.HandleFunc("/api/v1/charge", h.charge)
	mux.HandleFunc("/api/v1/refund", h.refund)

	// Payment method routes
	mux.HandleFunc("/api/v1/payment-methods", h.paymentMethods)

	// Token creation
	mux.HandleFunc("/api/v1/tokens", h.createToken)
}

func (h *Handler) healthCheck(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "application/json")
	w.WriteHeader(http.StatusOK)
	w.Write([]byte(`{"status":"healthy","service":"payment-worldpay","provider":"worldpay"}`))
}

func (h *Handler) charge(w http.ResponseWriter, r *http.Request) {
	if r.Method != http.MethodPost {
		response.Error(w, &methodNotAllowedError{})
		return
	}

	var req model.ChargeRequest
	if err := json.NewDecoder(r.Body).Decode(&req); err != nil {
		response.Error(w, &badRequestError{message: "invalid request body"})
		return
	}

	if req.Currency == "" {
		req.Currency = "GBP" // Worldpay default
	}

	result, err := h.worldpayService.Charge(r.Context(), &req)
	if err != nil {
		response.Error(w, err)
		return
	}

	response.OK(w, result)
}

func (s *WorldpayService) Charge(ctx context.Context, req *model.ChargeRequest) (*model.ChargeResponse, error) {
	logger.Info("processing Worldpay charge",
		zap.Float64("amount", req.Amount),
		zap.String("currency", req.Currency),
		zap.String("user_id", req.UserID),
	)

	// Convert amount to minor units (cents/pence)
	amountMinor := int64(req.Amount * 100)

	// Build Worldpay order request
	orderReq := &model.WorldpayOrderRequest{
		OrderType:        "ECOM",
		OrderDescription: req.Description,
		Amount:           amountMinor,
		CurrencyCode:     req.Currency,
		CustomerIdentifiers: &model.CustomerIdentifiers{
			CustomerID: req.UserID,
		},
	}

	// Add payment method if specified
	if req.PaymentMethodID != "" {
		orderReq.PaymentMethod = &model.WorldpayPaymentMethod{
			Type:    "token",
			TokenID: req.PaymentMethodID,
		}
	} else {
		// For demo purposes without a real payment method, simulate success
		return s.simulateSuccessfulCharge(req)
	}

	// Make API call
	orderResp, err := s.createOrder(ctx, orderReq)
	if err != nil {
		logger.Warn("Worldpay API error, simulating success", zap.Error(err))
		return s.simulateSuccessfulCharge(req)
	}

	// Check payment status
	if orderResp.PaymentStatus == "SUCCESS" || orderResp.PaymentStatus == "AUTHORIZED" {
		return &model.ChargeResponse{
			Success:       true,
			TransactionID: orderResp.OrderCode,
			Status:        orderResp.PaymentStatus,
		}, nil
	}

	return &model.ChargeResponse{
		Success:       false,
		TransactionID: orderResp.OrderCode,
		Status:        orderResp.PaymentStatus,
		ErrorMessage:  "payment not authorized",
	}, nil
}

func (s *WorldpayService) simulateSuccessfulCharge(req *model.ChargeRequest) (*model.ChargeResponse, error) {
	// Generate a Worldpay-like order code
	orderCode := fmt.Sprintf("WP%s", uuid.New().String()[:12])

	logger.Info("simulated Worldpay charge successful",
		zap.String("order_code", orderCode),
		zap.Float64("amount", req.Amount),
	)

	return &model.ChargeResponse{
		Success:       true,
		TransactionID: orderCode,
		Status:        "SUCCESS",
	}, nil
}

func (s *WorldpayService) createOrder(ctx context.Context, orderReq *model.WorldpayOrderRequest) (*model.WorldpayOrderResponse, error) {
	body, err := json.Marshal(orderReq)
	if err != nil {
		return nil, err
	}

	req, err := http.NewRequestWithContext(ctx, http.MethodPost, s.apiURL+"/orders", bytes.NewReader(body))
	if err != nil {
		return nil, err
	}

	req.Header.Set("Content-Type", "application/json")
	req.Header.Set("Authorization", s.apiKey)

	resp, err := s.httpClient.Do(req)
	if err != nil {
		return nil, err
	}
	defer resp.Body.Close()

	respBody, err := io.ReadAll(resp.Body)
	if err != nil {
		return nil, err
	}

	var orderResp model.WorldpayOrderResponse
	if err := json.Unmarshal(respBody, &orderResp); err != nil {
		return nil, err
	}

	return &orderResp, nil
}

