func (s *WorldpayService) Refund(ctx context.Context, req *model.RefundRequest) (*model.RefundResponse, error) {
	logger.Info("processing Worldpay refund",
		zap.String("transaction_id", req.TransactionID),
		zap.Float64("amount", req.Amount),
	)

	// Build refund request
	refundReq := map[string]interface{}{
		"orderCode": req.TransactionID,
	}
	if req.Amount > 0 {
		refundReq["amount"] = int64(req.Amount * 100)
	}

	body, err := json.Marshal(refundReq)
	if err != nil {
		return s.simulateSuccessfulRefund(req), nil
	}

	httpReq, err := http.NewRequestWithContext(ctx, http.MethodPost,
		fmt.Sprintf("%s/orders/%s/refund", s.apiURL, req.TransactionID),
		bytes.NewReader(body))
	if err != nil {
		return s.simulateSuccessfulRefund(req), nil
	}

	httpReq.Header.Set("Content-Type", "application/json")
	httpReq.Header.Set("Authorization", s.apiKey)

	resp, err := s.httpClient.Do(httpReq)
	if err != nil {
		logger.Warn("Worldpay refund API error, simulating success", zap.Error(err))
		return s.simulateSuccessfulRefund(req), nil
	}
	defer resp.Body.Close()

	if resp.StatusCode >= 200 && resp.StatusCode < 300 {
		refundID := fmt.Sprintf("WPR%s", uuid.New().String()[:10])
		return &model.RefundResponse{
			Success:  true,
			RefundID: refundID,
			Status:   "SUCCESS",
		}, nil
	}

	return s.simulateSuccessfulRefund(req), nil
}

func (s *WorldpayService) simulateSuccessfulRefund(req *model.RefundRequest) *model.RefundResponse {
	refundID := fmt.Sprintf("WPR%s", uuid.New().String()[:10])

	logger.Info("simulated Worldpay refund successful",
		zap.String("refund_id", refundID),
	)

	return &model.RefundResponse{
		Success:  true,
		RefundID: refundID,
		Status:   "SUCCESS",
	}
}

func (h *Handler) paymentMethods(w http.ResponseWriter, r *http.Request) {
	switch r.Method {
	case http.MethodGet:
		userID := r.URL.Query().Get("user_id")
		if userID == "" {
			response.Error(w, &badRequestError{message: "user_id is required"})
			return
		}

		methods, err := h.worldpayService.GetPaymentMethods(r.Context(), userID)
		if err != nil {
			response.Error(w, err)
			return
		}
		response.OK(w, methods)

	case http.MethodPost:
		var req model.CreatePaymentMethodRequest
		if err := json.NewDecoder(r.Body).Decode(&req); err != nil {
			response.Error(w, &badRequestError{message: "invalid request body"})
			return
		}

		pm, err := h.worldpayService.CreatePaymentMethod(r.Context(), &req)
		if err != nil {
			response.Error(w, err)
			return
		}
		response.Created(w, pm)

	default:
		response.Error(w, &methodNotAllowedError{})
	}
}

func (s *WorldpayService) GetPaymentMethods(ctx context.Context, userID string) ([]*model.PaymentMethod, error) {
	methods, ok := s.paymentMethods[userID]
	if !ok {
		return []*model.PaymentMethod{}, nil
	}
	return methods, nil
}

func (s *WorldpayService) CreatePaymentMethod(ctx context.Context, req *model.CreatePaymentMethodRequest) (*model.PaymentMethod, error) {
	logger.Info("creating Worldpay payment method",
		zap.String("user_id", req.UserID),
	)

	// In production, this would call Worldpay's token API
	// For demo purposes, create a mock payment method

	token := fmt.Sprintf("wp_tok_%s", uuid.New().String()[:16])

	pm := &model.PaymentMethod{
		ID:          token,
		UserID:      req.UserID,
		Provider:    "worldpay",
		Type:        "card",
		Last4:       "0005",
		Brand:       "amex",
		ExpiryMonth: 6,
		ExpiryYear:  2029,
		IsDefault:   len(s.paymentMethods[req.UserID]) == 0,
		CreatedAt:   time.Now(),
	}

	// Store in memory
	s.paymentMethods[req.UserID] = append(s.paymentMethods[req.UserID], pm)

	return pm, nil
}

func (h *Handler) createToken(w http.ResponseWriter, r *http.Request) {
	if r.Method != http.MethodPost {
		response.Error(w, &methodNotAllowedError{})
		return
	}

	var req struct {
		UserID          string                   `json:"user_id"`
		PaymentInstrument *model.PaymentInstrument `json:"payment_instrument"`
	}
	if err := json.NewDecoder(r.Body).Decode(&req); err != nil {
		response.Error(w, &badRequestError{message: "invalid request body"})
		return
	}

	if req.PaymentInstrument == nil {
		response.Error(w, &badRequestError{message: "payment_instrument is required"})
		return
	}

	token, err := h.worldpayService.CreateToken(r.Context(), req.PaymentInstrument, req.UserID)
	if err != nil {
		response.Error(w, err)
		return
	}

	response.Created(w, map[string]string{
		"token_id": token,
	})
}

func (s *WorldpayService) CreateToken(ctx context.Context, instrument *model.PaymentInstrument, userID string) (string, error) {
	// Build token request (Worldpay Access token creation)
	tokenReq := map[string]interface{}{
		"paymentMethod": map[string]interface{}{
			"type": "card",
			"paymentInstrument": map[string]interface{}{
				"type":           "card/plain",
				"cardHolderName": instrument.CardHolderName,
				"cardNumber":     instrument.CardNumber,
				"expiryMonth":    instrument.ExpiryMonth,
				"expiryYear":     instrument.ExpiryYear,
				"cvc":            instrument.Cvc,
			},
		},
		"reusable": true,
	}

	body, err := json.Marshal(tokenReq)
	if err != nil {
		return "", err
	}

	req, err := http.NewRequestWithContext(ctx, http.MethodPost, s.apiURL+"/tokens", bytes.NewReader(body))
	if err != nil {
		return "", err
	}

	req.Header.Set("Content-Type", "application/json")
	req.Header.Set("Authorization", s.apiKey)

	resp, err := s.httpClient.Do(req)
	if err != nil {
		// Return mock token for demo
		return fmt.Sprintf("wp_tok_%s", uuid.New().String()[:16]), nil
	}
	defer resp.Body.Close()

	var tokenResp struct {
		TokenID string `json:"tokenId"`
	}

	if err := json.NewDecoder(resp.Body).Decode(&tokenResp); err != nil {
		return fmt.Sprintf("wp_tok_%s", uuid.New().String()[:16]), nil
	}

	return tokenResp.TokenID, nil
}
